import React,{useState} from 'react';
import './App.css';
function App() {
  const posts = [
    {
      id:1,
      text:"This is First Post",
      likes:300
    },
    {
      id:2,
      text:"This is the Second Post",
      likes:200
    }
  ]
 const [p,setp] = useState(posts)


 const display =(
   <div>
   {posts.map((post)=>
   <>
    <p key={post.id}>
      {post.text}
    <span>{post.likes}</span></p>
  </>
   )}
   </div>
 );
 const likes = (
   posts.map((post)=>
   <h6 key={post.id}>{post.likes}</h6>
   )
 )
 return(
   <>
    {display}
    {likes}

   </>
 )
}

export default App;
